import React, { Component } from "react";
class Salinity extends Component {
  constructor(props) {
    super(props);
  }
  //Funtions

  render() {
    return (
      <div className="">
        <div className="text-center">
          <h5 className="text-warning">Độ mặn</h5>
          <h1 className="text-info">35%</h1>
        </div>
      </div>
    );
  }
}

export default Salinity;
